// src/App.js
import React, { useEffect, useState } from "react";
import axios from "axios";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import Chart from "chart.js/auto";

function App() {
  const [buoys, setBuoys] = useState([]);
  const [selected, setSelected] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [chartInstance, setChartInstance] = useState(null);

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/buoys")
      .then((r) => {
        if (r.data && r.data.buoys) {
          setBuoys(r.data.buoys);
        } else {
          setError("No buoy data received");
        }
      })
      .catch(() => setError("Failed to fetch buoy list"))
      .finally(() => setLoading(false));
  }, []);

  useEffect(() => {
    if (!selected) return;
    axios
      .get(`http://localhost:5000/api/buoy/${encodeURIComponent(selected.id)}`)
      .then((r) => {
        const detail = r.data?.data || {};

        if (chartInstance) chartInstance.destroy();

        const timestamps = detail.timestamps || ["00:00","01:00","02:00","03:00","04:00"];
        const values = detail.values || [1, 2, 1.5, 2.2, 1.8];

        const ctx = document.getElementById("buoyChart")?.getContext("2d");
        if (ctx) {
          const newChart = new Chart(ctx, {
            type: "line",
            data: {
              labels: timestamps,
              datasets: [
                {
                  label: `${selected.name} readings`,
                  data: values,
                  borderColor: "#00c6ff",
                  backgroundColor: "rgba(0,198,255,0.2)",
                  tension: 0.3,
                  fill: true,
                },
              ],
            },
            options: {
              responsive: true,
              plugins: { legend: { display: true, labels: { color: "white" } } },
              scales: {
                x: { title: { display: true, text: "Time", color: "white" }, ticks: { color: "white" } },
                y: { title: { display: true, text: "Value", color: "white" }, ticks: { color: "white" } },
              },
            },
          });
          setChartInstance(newChart);
        }
      });
  }, [selected]);

  if (loading) return <h2 className="text-white text-center mt-10">Loading buoys...</h2>;
  if (error) return <h2 className="text-red-400 text-center mt-10">{error}</h2>;

  return (
    <div className="flex h-screen bg-gradient-to-br from-blue-900 via-blue-800 to-blue-600 text-white">

      {/* Sidebar */}
      <div className="w-80 p-4 overflow-y-auto bg-blue-950/70 backdrop-blur-lg">
        <h2 className="text-xl font-bold mb-4">🌊 INCOIS Buoys</h2>

        <div className="space-y-2">
          {buoys.map((b) => (
            <button
              key={b.id}
              onClick={() => setSelected(b)}
              className={`w-full text-left px-4 py-2 rounded-lg transition ${
                selected?.id === b.id ? "bg-blue-600" : "bg-blue-800 hover:bg-blue-700"
              }`}
            >
              {b.name}
            </button>
          ))}
        </div>

        {selected && (
          <div className="mt-6 bg-blue-900/70 p-4 rounded-xl shadow-md">
            <h4 className="text-lg font-semibold mb-2">{selected.name} – Details</h4>
            <p className="text-sm mb-4">
              Lat: {selected.lat ?? "N/A"}, Lon: {selected.lon ?? "N/A"}
            </p>
            <canvas id="buoyChart" width="320" height="200"></canvas>
          </div>
        )}
      </div>

      {/* Map Section */}
      <div className="flex-1 relative">
        <MapContainer center={[15, 80]} zoom={4} style={{ height: "100%" }}>
          <TileLayer
            attribution="&copy; OpenStreetMap contributors"
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />
          {buoys.map((b, i) => {
            const lat = b.lat ?? 15 + i * 0.5;
            const lon = b.lon ?? 80 + i * 0.5;
            return (
              <Marker key={b.id} position={[lat, lon]}>
                <Popup>
                  <strong>{b.name}</strong>
                  <br />
                  <button onClick={() => setSelected(b)}>Details</button>
                </Popup>
              </Marker>
            );
          })}
        </MapContainer>
      </div>
    </div>
  );
}

export default App;
